import { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import { toast } from 'react-toastify';
import { getByIdAPI, updateAPI } from '../Service/Product';

function UpdateUser() {
    const { id } = useParams();
    const [product, setProduct] = useState({ proName: '', proPrice: '' });
    const [name, setName] = useState('');
    const [price, setPrice] = useState('');
    const navigate = useNavigate();

    const fetchData = async () => {
        try {
            const response = await getByIdAPI(id);
            const productData = response.data[0];
            setProduct(productData);
        } catch (error) {
            console.error('Error fetching product data:', error);
            // Handle error, show toast message, etc.
        }
    };

    useEffect(() => {
        fetchData();
    }, [id]);

    const onUpdate = async () => {
        try {
            await updateAPI(id, { proName: name, proPrice: price });
            toast.success('Product updated successfully');
            navigate('/getAll');
        } catch (error) {
            console.error('Error updating product:', error);
            toast.error('Error updating product');
        }
    };

    const onCancel = () => {
        navigate('/getAll');
    };

    return (
        <div className="mt-5">
            <div className="heading"><h2>Update Page</h2></div>
            <div className="row">
                <div className="col"></div>
                <div className="col">
                    <div className="form form-div">
                        <div className='mt-5'>
                            <label>Product Name:</label>
                            <input
                                onChange={(e) => setName(e.target.value)}
                                value={name}
                                type="text"
                                className="form-control"
                            />
                        </div>
                        <div className="mt-5">
                            <label>Product Price:</label>
                            <input
                                onChange={(e) => setPrice(e.target.value)}
                                value={price}
                                type="number"
                                className="form-control"
                            />
                        </div>
                        <div className='mb-3'>
                            <center>
                                <button onClick={onUpdate} className='mt-4 btn btn-success'>UPDATE</button>
                                <button onClick={onCancel} className='mt-4 ms-4 btn btn-primary'>CANCEL</button>
                            </center>
                        </div>
                    </div>
                </div>
                <div className="col"></div>
            </div>
        </div>
    );
}

export default UpdateUser;
